import React, { Component } from 'react'
import { Form } from 'react-bootstrap'

export default class NewCheckboxes extends Component {
  render() {
    return (
      <div>
        <Form>
            {['checkbox'].map(type => (
                <div key={`custom-${type}`} className="mb-3">
                <Form.Check 
                    custom
                    type={type}
                    id={`custom-${type}`}
                    label={`NYC ${type}`}
                />
                <Form.Check 
                    custom
                    type={type}
                    id={`custom-${type}`}
                    label={`Boston ${type}`}
                />
                <Form.Check 
                    custom
                    type={type}
                    id={`custom-${type}`}
                    label={`DC ${type}`}
                />
                </div>
            ))}
        </Form>
      </div>
    )
  }
}
